import React from 'react';

const AdminNotifications = () => (
  <div style={{ color: '#E5E7EB', maxWidth: '600px', margin: '0 auto' }}>
    <h2 style={{ color: '#2ECC71', fontWeight: 700, fontSize: '1.7rem', marginBottom: '1.2rem' }}>Notifications</h2>
    <div style={{ background: '#23272F', borderRadius: '1rem', padding: '2rem', boxShadow: '0 2px 12px rgba(0,0,0,0.08)' }}>
      <p>Admin notifications will appear here. (Coming soon)</p>
    </div>
  </div>
);

export default AdminNotifications;
